style.css:
@-moz-document regexp("https://www.youtube.com/(|\\?(reload|pbjreload).*)") {
html:not([dark="true"]) ytd-app,
html:not([dark="true"]) ytd-mini-guide-renderer,
html:not([dark="true"]) ytd-mini-guide-entry-renderer
{background-color:white!important}

ytd-app,
ytd-mini-guide-renderer,
ytd-mini-guide-entry-renderer{background-color:rgb(36,36,36)!important}

ytd-app[is-watch-page] #masthead-container{transition:unset!important;opacity:1!important}
[dark] .gstl_50.sbdd_a *{background-color:var(--yt-searchbox-background)!important}
ytd-topbar-logo-renderer#logo{position:fixed!important;top:calc(50vh - 110px);left:calc(50% - 150px);background:url(https://upload.wikimedia.org/wikipedia/commons/thumb/b/b8/YouTube_Logo_2017.svg/2000px-YouTube_Logo_2017.svg.png)!important;width:300px!important;height:67px!important;background-size:300px 67px!important}
ytd-topbar-logo-renderer#logo *,#guide-button,#guide-spacer,#country-code,.ytd-mealbar-promo-renderer{display:none!important}
ytd-app{background-color:var(--yt-live-chat-action-panel-background-color-transparent)!important}
#guide-persistent-and-visible,
#home-page-skeleton,#masthead-logo{opacity:0!important}
#guide-content.ytd-app{background:unset!important}
app-drawer.ytd-app[persistent]{z-index:999999!important}
#search-form #container {position:fixed!important;top:calc(50vh + 0px);left:calc(50% - 292px)!important;width:584px!important;height:44px!important;border-radius:2px!important;box-shadow:0 2px 2px 0 rgba(0,0,0,0.16), 0 0 0 1px rgba(0,0,0,0.08)!important;transition:box-shadow 200ms cubic-bezier(0.4, 0.0, 0.2, 1)!important;padding:0 6px!important}
#search-form #container:hover{box-shadow:0 3px 8px 0 rgba(0,0,0,0.2), 0 0 0 1px rgba(0,0,0,0.08)!important}
ytd-searchbox[has-focus] #search-form #container{box-shadow:0 3px 8px 0 rgba(0,0,0,0.2), 0 0 0 1px rgba(0,0,0,0.08)!important}
.sbsb_b{max-height:150px!important;overflow-y:scroll}
.ytd-searchbox{border:0!important}
.gstl_50.sbdd_a{left:calc(50% - 292px)!important;top:calc(50vh + 40px)!important}
#search-icon-legacy{visibility:hidden!important}
#masthead-container.ytd-app::after{box-shadow:none!important}
app-drawer{opacity:0!important;transition:opacity .3s ease-out!important;}
app-drawer:hover{opacity:1!important}
.skeleton-bg-color{background-color:transparent!important}
ytd-page-manager{display:none!important}
@media only screen and (max-width: 656px) {
#search-button{display:none!important}
#search-form:not(#a) #container{width:calc(100% - 25px)!important;left:5px!important;}
ytd-masthead[show-input] #guide-button.ytd-masthead, ytd-masthead[show-input] #logo.ytd-masthead, ytd-masthead[show-input] #end.ytd-masthead,ytd-searchbox.ytd-masthead{display:block!important}
ytd-topbar-logo-renderer#logo {background-size:200px 45px!important;width:200px!important;height:45px!important;
top:calc(50vh - 75px)!important;left:calc(50% - 100px)!important}
.gstl_50.sbdd_a{left:5px!important;width:calc(100% - 25px)!important}}
[dark] {height:100%!important;background:rgb(35,35,35)!important}
[dark] ytd-topbar-logo-renderer#logo{background-image:url(data:image/png;base64,)!important}}

@-moz-document domain("youtube.com") {/*[[T]]*/
/*[[c]]*//*[[rv]]*//*[[lc]]*/ytd-browse[page-subtype="home"],.ytp-cards-teaser,.ytp-ad-overlay-image,.iv-promo-website-card-cta-redesign,.ytp-ad-player-overlay-instream-info,ytd-mealbar-promo-renderer{display:none!important}
[dark] .gstl_50.sbdd_a *{background-color:#232323!important;border-color:#282828!important}
[dark] .gsfs,[dark] .sbpqs_a{color:#FFF!important}
[dark] yt-page-navigation-progress {background-color:#202020!important}
ytd-watch-flexy[flexy_] #secondary.ytd-watch-flexy{width:unset!important;min-width:unset!important;max-width:var(--ytd-watch-flexy-sidebar-width)!important}
[is-two-columns_] #container.ytd-playlist-panel-renderer,ytd-live-chat-frame{min-width:var(--ytd-watch-flexy-sidebar-min-width)!important;width:var(--ytd-watch-flexy-sidebar-width)!important}
ytd-watch-flexy:not([theater]) video{width:100%!important;height:auto!important}
ytd-live-chat-frame[collapsed]{margin-top:38px!important}
@media only screen and (min-width:1000px){
#primary{max-width:calc(100vw - var(--ytd-watch-flexy-sidebar-width))!important}}}

options.value:
ytd-app[is-watch-page] ytd-watch[theater] #player,
ytd-app[is-watch-page] ytd-watch-flexy[theater] #player-theater-container
{max-height: 100vh !important;min-height: 100vh !important}
ytd-app[is-watch-page] #masthead-container{opacity:0!important;transition:opacity 0.2s ease-in-out}
ytd-app[is-watch-page] #masthead-container:hover{opacity:1!important}
ytd-app[is-watch-page] #page-manager{margin-top:0!important}
ytd-app[is-watch-page] #extra-buttons{display:none!important}
ytd-app[is-watch-page] #toast:not(.paper-toast-open){pointer-events:none}
